import React, { Component } from 'react';
import { connect } from 'react-redux';
import { withStyles } from '@material-ui/core/styles';
import styles from './auto-predict-bullet.style';
import FiberManualRecord from '@material-ui/icons/FiberManualRecord';
import { PredictionConstant } from '../../../constants/prediction.constant';
import { disableAutoPredictClick } from '../../../actions/left-nav.action';

class AutoPredictBullet extends Component {

  getBulletClass() {
    const { predictionStatusCode } = this.props;
    switch (predictionStatusCode) {
      case PredictionConstant.ISSUE_FOUND:
        return ' color-red';
      case PredictionConstant.NO_ISSUE_FOUND:
        return ' color-green';
      default:
        this.props.disableAutoPredictClick();
        return '';
    }
  }

  render() {
    const { classes } = this.props;
    return (
      <React.Fragment>
        <FiberManualRecord className={classes.bullet + this.getBulletClass()} />
      </React.Fragment>
    )
  }
}

const mapStateToProps = state => {
  return {
    predictionStatusCode: state.prediction.predictionStatusCode,
  };
};

const mapDispatchToProps = dispatch => ({
  disableAutoPredictClick: () => dispatch(disableAutoPredictClick())
});

export default connect(mapStateToProps, mapDispatchToProps)(withStyles(styles)(AutoPredictBullet));
